/* CREATE TABLE */
CREATE TABLE journal_entry(
journal_entry_id DOUBLE,
company_id DOUBLE,
journal_type_id DOUBLE,
journal_entry_code VARCHAR(100),
journal_entry VARCHAR(100),
serial_number DOUBLE,
entry_date VARCHAR(100),
debit_credit_balanced DOUBLE,
cancelled DOUBLE,
audited DOUBLE,
closing_type DOUBLE,
last_modified VARCHAR(100),
user_id DOUBLE
);


/* CREATE TABLE */
CREATE TABLE account(
account_id DOUBLE,
company_id DOUBLE,
account_code VARCHAR(100),
account VARCHAR(100),
balance_sheet_order DOUBLE,
profit_loss_order DOUBLE,
postable DOUBLE,
visible_for_posting DOUBLE,
inventory_type DOUBLE,
bank_account_type DOUBLE,
balance_sheet_section_id DOUBLE,
profit_loss_section_id DOUBLE,
fiscal_id DOUBLE,
last_modified VARCHAR(100),
user_id DOUBLE
);

/* CREATE TABLE */
CREATE TABLE company_address(
company_id DOUBLE,
phone_number VARCHAR(100),
address_line_1 VARCHAR(100),
address_line_2 VARCHAR(100),
zip VARCHAR(100),
city VARCHAR(100),
state VARCHAR(100),
county VARCHAR(100),
modified_date VARCHAR(100),
user_id DOUBLE
);

/* CREATE TABLE */
CREATE TABLE company_type_id(
company_id DOUBLE,
company_type_code VARCHAR(100),
company_type VARCHAR(100)
);

/* CREATE TABLE */
CREATE TABLE company_user(
company_id DOUBLE,
user_id DOUBLE
);

/* CREATE TABLE */
CREATE TABLE company(
company_id DOUBLE,
company_code VARCHAR(100),
company VARCHAR(100),
control VARCHAR(100)
);

/* CREATE TABLE */
CREATE TABLE criterion(
company_id DOUBLE,
company_code VARCHAR(100),
company VARCHAR(100),
control VARCHAR(100)
);

/* CREATE TABLE */
CREATE TABLE format(
format_id DOUBLE,
company_id DOUBLE,
table_format VARCHAR(100),
table_format_id DOUBLE,
datawindow VARCHAR(100),
origin_table VARCHAR(100),
origin_table_id DOUBLE,
last_modified VARCHAR(100),
user_id DOUBLE
);

/* CREATE TABLE */
CREATE TABLE id(
table_id VARCHAR(100),
company_id DOUBLE,
id DOUBLE,
label VARCHAR(100),
id_type DOUBLE
);

/* CREATE TABLE */
CREATE TABLE journal_entry_line_item(
journal_entry_id DOUBLE,
line_item DOUBLE,
company_id DOUBLE,
account_id DOUBLE,
description VARCHAR(100),
debit DOUBLE,
credit DOUBLE
);

/* CREATE TABLE */
CREATE TABLE journal_entry_type(
journal_type_id DOUBLE,
